type DestroyHubsPayload {
  errors: [String!]!
  success: Boolean!
}

type Hub {
  ch: String
  date: ISO8601Date
  function: String
  iata: String
  id: ID!
  lat: Float
  lng: Float
  locode: String!
  name: String!
  nameWoDiacritics: String!
  remarks: String
  status: String
  subDiv: String
}

type HubsQueryResponse {
  nextPage: Int
  page: [Hub!]!
  totalHubs: Int!
  totalPages: Int!
}

scalar ISO8601Date

type Mutation {
  destroyHubs: DestroyHubsPayload
  populateHubs: PopulateHubsPayload
}

"""
