"""
type PopulateHubsPayload {
  errors: [String!]!
  success: Boolean!
}

type Query {
  hubs(filter: QueryFilter, order: QueryOrder, page: Int, pageSize: Int): HubsQueryResponse!
  nearestHubToAddress(address: String!): Hub!
  nearestHubToCoordinates(lat: Float!, lng: Float!): Hub!
}

input QueryFilter {
  key: String!
  value: String!
}

input QueryOrder {
  desc: Boolean
  key: String!
}
